import React from 'react';
import './UserProfile.css';

interface UserProfileProps{

}

const UserProfile = ({

}) => {
  return (

    <div className="profile-container">

      <div className="profile-card">

        <button className="back-btn">← 返回</button>


        <div className="profile-header">
          <div className="profile-avatar">
            <img 
              src="https://picsum.photos/180/180" 
              alt="User Avatar"
            />

            <div className="avatar-change">Change Avatar</div>
          </div>
        </div>


        <div className="profile-actions">
          <button className="profile-btn secondary-btn">User Information</button>
          <button className="profile-btn secondary-btn">Change Password</button>
          <button className="profile-btn logout-btn">Cancel Account</button>
        </div>
      </div>
    </div>
  );
};

export default UserProfile;
